1. Introduction
Figure 1 The work entitled “Quantum Clouds” inspired by “Instant City In a Field, Typical Set-up” by Archigram (Cook 2022). The piece
was produced by the author through collaging several NST images using TensorFlow and Google CoLab, along with post processing and
color calibration in photoshop. See Fig 2.3 for more detail about the NST process for this image.
